import React from 'react';
class readData extends React.Component
{
  constructor(props)
  {
    super(props);
    this.jsonData=this.props.jsonData;
  }
  readData()
  {
    var ret="";
    for(let data in this.jsonData)
    {
      if(typeof(this.jsonData[data])=="object")
        readData(this.jsonData[data]);
      if(typeof(this.jsonData[data])!="object" && data!="Brand")
        return ( 
          <div>{data} : {this.jsonData[data]}</div>
        );
    }
    return <div>{ret}</div>;
  } 
}
export default readData;
